import React from 'react';
import { connect, useDispatch } from "react-redux";
import ButtonLink from '../../UserInterface/Buttons/Button/ButtonLink';
import { startGetRequestServer } from '../../store/serverViewType/actions/actionViewType';

function Header() {

    const dispatch = useDispatch();

    return (
        <header>
            <nav>
                
                    <ButtonLink
                        to='/'
                        name='Home'
                        classname=''
                        tabIndex='1'
                    />
                    <ButtonLink
                        to='/ViewType'
                        name='ViewType'
                        onclick={() => { dispatch(startGetRequestServer()) }}
                        classname=''
                        tabIndex='2'
                    />

            </nav>
        </header>
    )
}
export default connect()(Header)
